import "../styles/logo.scss"

const Logo = () => {
  return (
    <div className="logo-container">
      <img src='/images/icon8-services.gif' alt="Pinion Logo is a lightbulb with gears on both sides" />
        <p>PiNiON <span>GAMES</span></p>
    </div>
  )
}

export default Logo
